import React from 'react'
import { useParams } from 'react-router-dom'

const EventDetailsPage = () => {

  const {eventId} = useParams()
  return (
    <p className='absolutePositioned'>
      Event Details : {eventId}
    </p>
  )
}

export default EventDetailsPage
